                      time_stamp,classification,category,status,ucf_mmobj_vch1,ucf_mmobj_vch2,ucf_mmobj_vch3,ucf_mmobj_vch4,
                      ucf_mmobj_vch5,ucf_mmobj_num1,ucf_mmobj_date1,ucf_mmobj_flag1,text_data)
    values(v_object_id,v_object_type,v_object_tag,v_object_rev,v_object_desc,v_stype,v_owner_group,
            user,sysdate,v_classification,v_category,v_status,v_ucf_mmobj_vch1,v_ucf_mmobj_vch2,
            v_ucf_mmobj_vch3,v_ucf_mmobj_vch4,v_ucf_mmobj_vch5,v_ucf_mmobj_num1,v_ucf_mmobj_date1,
            v_ucf_mmobj_flag1,replace(v_iclob,'"',chr(39)));
commit;
exception when dup_val_on_index then
  begin
  update sfcore_mm_object
  set object_desc=v_object_desc,stype=v_stype,owner_group=v_owner_group,updt_userid=user,
time_stamp=sysdate,classification=v_classification,category=v_category,
status=v_status,ucf_mmobj_vch1=v_ucf_mmobj_vch1,ucf_mmobj_vch2=v_ucf_mmobj_vch2,
ucf_mmobj_vch3=v_ucf_mmobj_vch3,ucf_mmobj_vch4=v_ucf_mmobj_vch4,ucf_mmobj_vch5=v_ucf_mmobj_vch5,
ucf_mmobj_num1=v_ucf_mmobj_num1,ucf_mmobj_date1=v_ucf_mmobj_date1,ucf_mmobj_flag1=v_ucf_mmobj_flag1,
text_data=replace(v_iclob,'"',chr(39))
  where object_id=v_object_id;
  commit;
  exception when others then
  	 sffnd_show_execution_message('DML',v_object_tag, SQLCODE,SQLERRM,' update sfcore_mm_object ');
  end;
when others then
  sffnd_show_execution_message('DML',v_object_tag, SQLCODE,SQLERRM,' insert into sfcore_mm_object ');
end;
begin
if v_folder_id is not null then
insert into sfcore_mm_object_folder_xref(folder_id,object_id,updt_userid,time_stamp)
values(v_folder_id,v_object_id,user,sysdate);
commit;
end if;
exception when others then 
 sffnd_show_execution_message('DML',v_object_tag, SQLCODE,SQLERRM,' insert into sfcore_mm_object_folder_xref ');
end;
end;
